import React, { useEffect } from 'react';
import { useTranslation } from 'react-i18next';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faDownload, 
  faBirthdayCake, 
  faPhone, 
  faEnvelope, 
  faMapMarkerAlt, 
  faBriefcase 
} from '@fortawesome/free-solid-svg-icons';
import './About.css';

const About = () => {
  const { t } = useTranslation();

  // Forzar visibilidad despuÃ©s de la carga
  useEffect(() => {
    const timer = setTimeout(() => {
      const aboutContent = document.querySelector('.about-content');
      if (aboutContent) aboutContent.style.opacity = '1';
      
      const aboutText = document.querySelector('.about-text');
      if (aboutText) aboutText.style.opacity = '1';
      
      const aboutInfo = document.querySelector('.about-info');
      if (aboutInfo) aboutInfo.style.opacity = '1';
    }, 500);
    
    return () => clearTimeout(timer);
  }, []);

  // Animaciones
  const containerVariants = {
    hidden: { opacity: 0.5 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { y: 15, opacity: 0.5 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        type: 'spring',
        stiffness: 100,
        duration: 0.4
      }
    }
  };

  return (
    <section id="sobre-mi" className="about-section">
      <div className="container">
        <motion.div
          className="section-title"
          initial={{ opacity: 0.5, y: -10 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.2 }}
          transition={{ delay: 0.1, duration: 0.3 }}
          style={{ opacity: 1 }}
        >
          <h2>{t('about.titulo')}</h2>
          <div className="underline"></div>
        </motion.div>

        <motion.div 
          className="about-content"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true, amount: 0.2 }}
          style={{ opacity: 1 }}
        >
          <motion.div 
            className="about-text"
            variants={itemVariants}
            style={{ opacity: 1 }}
          >
            <p>
              Soy un desarrollador web con mÃ¡s de 5 aÃ±os de experiencia en el desarrollo de aplicaciones 
              web y sitios usando tecnologÃ­as como Drupal, Angular, React y .NET.
            </p>
            <p>
              Mi enfoque estÃ¡ en crear soluciones digitales que no solo cumplan con los requisitos 
              tÃ©cnicos, sino que tambiÃ©n ofrezcan una excelente experiencia de usuario. Me especializo 
              en el desarrollo frontend y backend, con un fuerte Ã©nfasis en la creaciÃ³n de interfaces 
              limpias y funcionales.
            </p>
            <p>
              A lo largo de mi carrera, he trabajado con diversas empresas y organizaciones, 
              desde startups hasta grandes corporaciones, ayudÃ¡ndoles a materializar sus ideas 
              y mejorar su presencia digital.
            </p>
            
            <div className="cv-download">
              <a href="/assets/CV_Diego_Moreno.pdf" className="download-btn" download>
                <FontAwesomeIcon icon={faDownload} />
                {t('about.descargarCV')}
              </a>
            </div>
          </motion.div>
          
          <motion.div 
            className="about-info"
            variants={itemVariants}
            style={{ opacity: 1 }}
          >
            <h3>{t('about.datosPersonales')}</h3>
            <ul className="info-list">
              <li>
                <FontAwesomeIcon icon={faBirthdayCake} />
                <span className="info-title">{t('about.cumpleanos')}:</span>
                <span>13 de Febrero, 1987</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faPhone} />
                <span className="info-title">{t('about.telefono')}:</span>
                <span>+34 600 000 000</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faEnvelope} />
                <span className="info-title">Email:</span>
                <span>info@diegomoreno.dev</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faMapMarkerAlt} />
                <span className="info-title">{t('about.direccion')}:</span>
                <span>Valencia, EspaÃ±a</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faBriefcase} />
                <span className="info-title">{t('about.cargo')}:</span>
                <span>Desarrollador Web Full-Stack</span>
              </li>
            </ul>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
